import React from 'react';
import Header from './features/header/Header';
import Footer from './features/footer/Footer';
import Rightside from './features/right_side/Rightside';
import Leftside from './features/left_side/Leftside'
import Authentication from './features/authentication/Authentication';
import Register from './features/authentication/Register';
import { Route, Routes } from 'react-router-dom'
import MainShop from './features/main_shop/MainShop';
import Cart from './features/main_shop/Cart';



function App() {
  return (
    <div >
      <div className="row">
        <Header/>
      </div>
      <div className="row">
        <Authentication/>
        <Register/>
      </div>
      <div className="row">
        <Leftside/>
        <Routes>
        <Rightside>
          <Route path='/'>
            <Route path='/shop' element={<MainShop/>}></Route>
            <Route path='/cart' element={<Cart/>}></Route>
            </Route>
        </Rightside>
        </Routes>

      </div>
      <div className="row">
        <Footer></Footer>
      </div>
    </div>
  );
}

export default App;
